import * as React from "react";
import Box from "@mui/material/Box";
import Slider from "@mui/material/Slider";

const Prices = [
  {
    _id: 0,
    name: "$0 to 19",
    array: [0, 19],
  },
  {
    _id: 1,
    name: "$20 to 39",
    array: [20, 39],
  },
  {
    _id: 2,
    name: "$40 to 59",
    array: [40, 59],
  },
  {
    _id: 3,
    name: "$60 to 79",
    array: [60, 79],
  },
  {
    _id: 4,
    name: "$80 to 99",
    array: [80, 99],
  },
  {
    _id: 4,
    name: "$100 or more",
    array: [100, 9999],
  },
];

function valuetext(value) {
  return `${value}`;
}

export default function PriceFilter() {
  return (
    <Box sx={{ width: 300 }}>
      <h4 className="text-medium text-gray-800 font-bold mb-2">
        Filter by Price
      </h4>
      <Slider
        defaultValue={60}
        getAriaValueText={valuetext}
        step={10}
        marks={Price}
        valueLabelDisplay="on"
      />
    </Box>
  );
}
